  Creo que podemos decir que la relacioÃÅn con mis companÃÉeros no es la mejor, pero de nuevo, no le vamos a agradar a todos. Los suenÃÉos realmente no necesitaban el grupo, pero se sentiÃÅan aburridos. Nadie sabe lo que son, toman diferentes formas y son sumamente extrovertidos; todo lo hacen bien y estaÃÅn llenos de inspiraciones e ideas un poco empalagosas para mi. Eso de los finales felices solamente es real para ellos, yo como la vida he visto demasiadas desilusiones y la muerte pues‚Ä¶ es la muerte. Cada diÃÅa me llaman a eso de la 7 p.m. buscando historias interesantes para adaptarlas a su modo. PodriÃÅamos decir que son como un escritor que roba palabras. Estas historias o aventuras manipuladas son su regalo a los humanitos. Siempre le digo que mantenga las verdades como son, se antoja en cambiarlas y honestamente los confunde, son seres muy simples. Esta rutina se repite diÃÅa a diÃÅa y los humanos parecen estar adictos, nunca he entendido como alguien puede vivir a base de una mentira, o por lo menos inspirado por una. Aunque es un factor muy comuÃÅn, los humanos se mudan a distintos lugar pensando que encontraraÃÅn un brote de felicidad y que del cielo lloveraÃÅn trabajos y bendiciones. Lo se, es una imagen muy bonita y las ideas bonitas siempre crean contacto con el corazoÃÅn. 

	Si te soy honesto me asombreÃÅ mucho con la creacioÃÅn del corazoÃÅn, un oÃÅrgano que sin la capacidad de pensar, provoca una gran toma de decisiones. Recuerdo que el cerebro le teniÃÅa un odio muy profundo, el que de por si se comporta como un viejo fanfarroÃÅn, quejaÃÅndose y buscaÃÅndole la loÃÅgica a todo. Eso era lo que me agradoÃÅ tanto del repartidor de sangre, cumpliÃÅa con su trabajo y en el tiempo libre se dedicaba a inculcar pasioÃÅn. Un oÃÅrgano muy honesto y puro, cuando le tocaba sufrir lo haciÃÅa como mucha transparencia; no se aguantaba las laÃÅgrimas, se desborda hasta que los humanitos recobraban fuerzas. De maÃÅs esta decir que la relacioÃÅn que nacioÃÅ entre el y los suenÃÉos es muy muy fuerte, pero el corazoÃÅn trabaja como bruÃÅjula que los dirige hacia su pasioÃÅn. #WritewithJEP #ArtwithJEP";}i:212;a:1:{s:14:"comments_count";i:3;}i:213;a:1:{s:11:"likes_count";i:13;}i:214;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEu1H-sBmTB";}i:215;a:1:{s:5:"image";s:250:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118791521_1295449990795839_7021007846381013586_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=103&_nc_ohc=JaXtBfmxKusAX_n5PYD&oh=b17cf16f6b134a1f855320b83d735d16&oe=5F7B94EE";}i:216;a:1:{s:4:"type";s:5:"image";}i:217;a:1:{s:8:"owner_id";i:2297722765;}i:218;a:1:{s:14:"owner_username";s:0:"";}i:219;a:1:{s:14:"owner_fullname";s:0:"";}i:220;a:1:{s:9:"owner_pic";s:0:"";}i:221;a:1:{s:2:"id";s:19:"2391081965662365174";}i:222;a:1:{s:10:"short_code";s:11:"CEu1GEYJeX2";}i:223;a:1:{s:12:"created_time";i:1599259204;}i:224;a:1:{s:7:"caption";s:463:"Ciudad Espejismo
